import React, {Component} from 'react';

function Navbar(){
  return(
    <nav>
      <ul>
        <li><a href="#"><h3>DigitalQ</h3></a></li>
        <li><a href="#about"><h3>About</h3></a></li>
        <li><a href="#product"><h3>Product</h3></a></li>
        <li><a href="#contact"><h3>DigitalQ</h3></a></li>
        <li><a href="review.js"><h3>Review</h3></a></li>
        <li><a href="login.js"><h3>LOGIN</h3></a></li>
      </ul>
    </nav>
  );
}

function Header(){
  return(
    <header>
      <h2>Selamat Datang di</h2>
      <h3>DigitalQ</h3>
      <a href="#about">CARI TAHU SEKARANG</a>
    </header>
  );
}

function Section1(){
  return(
    <section id="about">
      <u>Sekilas Tentang Kami</u>
      <p><b>DigitalQ </b>merupakan toko elektronik terpercaya yang menjual bervariasi laptop dan handphone berkualitas dengan harga terjangkau. DigitalQ siap menjamin kepuasan pelanggan.</p>
      <img src="2.jpg" />
    </section>
  );
}

class Section2 extends React.Component{
  render(){
      return(
          <section class="product" id="product">
              <div class="teks3">PRODUK</div>
              <div class="teks4">Apa yang Anda Cari?</div>

              <div class="row">
                  <div class="col-4 col-s-12">
                      <a href="produk.html#laptop"><i class="fa fa-laptop"></i></a>
                      <p><b>LAPTOP</b></p>
                  </div>
                  <div class="col-4 col-s-12">
                      <a href="produk.html#hp"><i class="fa fa-mobile"></i></a>
                      <p><b>HANDPHONE</b></p>
                  </div>
                  <div class="col-4 col-s-12">
                      <a href="produk.html#dll"><i class="fa fa-print"></i></a>
                      <p><b>PRINTER & AKSESORIS</b></p>
                  </div>
              </div>
          </section>
      )
  }
}
